# National Register of Historic Places listings in Independence County, Arkansas

__NOTOC__
This is a list of the National Register of Historic Places listings in Independence County, Arkansas.
This is intended to be a complete list of the properties and districts on the National Register of Historic Places in Independence County, Arkansas, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.
There are 45 properties and districts listed on the National Register in the county. Another 2 properties were once listed but were removed.
